import React, { useState, useEffect } from "react";
import axios from "axios";
import "../styles/AdminDashboard.css";

const AdminDashboard = () => {
  const [users, setUsers] = useState([]);
  const [newUser, setNewUser] = useState({
    firstname: "",
    lastname: "",
    email: "",
    password: "",
    userType: "student",
  });
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    fetchUsers();
  }, []);

  // Fetch all registered users
  const fetchUsers = async () => {
    setLoading(true);
    setError(null);
    try {
      const token = localStorage.getItem("authToken");
      const response = await axios.get("http://localhost:5000/api/users/all-users", {
        headers: { Authorization: `Bearer ${token}` },
      });
      setUsers(response.data);
    } catch (err) {
      console.error("Error fetching users:", err);
      setError("Failed to fetch users.");
    } finally {
      setLoading(false);
    }
  };

  // Add a new user
  const addUser = async () => {
    try {
      const token = localStorage.getItem("authToken");
      if (!newUser.firstname || !newUser.lastname || !newUser.email || !newUser.password) {
        alert("All fields are required.");
        return;
      }

      await axios.post("http://localhost:5000/api/auth/register", newUser, {
        headers: { Authorization: `Bearer ${token}` },
      });

      setNewUser({ firstname: "", lastname: "", email: "", password: "", userType: "student" });
      fetchUsers();
    } catch (err) {
      alert("Failed to add user.");
    }
  };

  return (
    <div className="admin-dashboard">
      {/* Sidebar */}
      <div className="sidebar">
        <h2>BukSU Admin</h2>
        <ul>
          <li>Dashboard</li>
          <li>Lost Items</li>
          <li>Found Items</li>
          <li>Notifications</li>
          <li>Bookmarks</li>
        </ul>
        <button className="logout-btn">Logout</button>
      </div>

      {/* Main Content */}
      <div className="main-content">
        <h2>All Items</h2>
        <div className="card">
          <img
            src="https://via.placeholder.com/600x300"
            alt="Example"
            className="item-image"
          />
          <div className="card-details">
            <p>
              <strong>Nawala ang 1 million dollar</strong> sa Old CSDT, please contact me if kinsay
              nakakita.
            </p>
            <p>Email: <a href="mailto:student@example.edu.ph">student@example.edu.ph</a></p>
            <p>Category: Other</p>
            <p>Post Type: Lost</p>
          </div>
        </div>

        {/* Registered Users */}
        <div className="users-table">
          <h3>Registered Users</h3>
          {loading ? (
            <p>Loading users...</p>
          ) : error ? (
            <p>{error}</p>
          ) : (
            <table>
              <thead>
                <tr>
                  <th>First Name</th>
                  <th>Last Name</th>
                  <th>Email</th>
                  <th>User Type</th>
                </tr>
              </thead>
              <tbody>
                {users.map((user) => (
                  <tr key={user._id}>
                    <td>{user.firstname}</td>
                    <td>{user.lastname}</td>
                    <td>{user.email}</td>
                    <td>{user.userType}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>
      </div>
    </div>
  );
};

export default AdminDashboard;
